(5, 6, 1002, 'ท่อ Yochimura', 'ท่อสุดยอดของโลกที่โด่งดังทั้งคุณภาพในการใช้งานและแข่งขัน มีหลากหลายรุ่นสำหรับรถทุกยี่ห้อ\r\nทำโปรโมชั่นพิเศษครับ เมื่อซื้อท่อYOSHIMURA ที่ร้าน DIRTSHOP ให้บริการฟรี วัดแรงม้า สองครั้ง ก่อนใส่ และหลังใส่ เพื่อพิสูจน์แรงม้าได้แบบเห็นๆ', 19500, 5);

